import Friend from "../friend/Friend";
import "./friends.css";
import { Users } from "../../dummyData";

export default function Friends() {
  return (
    <div className="friendsContainer">
      <h3 className="friendsTitle">User Friends</h3>
      {Users.map((friend) => (
        <Friend key={friend.id} friend={friend} />
      ))}
    </div>
  );
}
